import React, { useState, useEffect } from 'react';
import axios from 'axios';

function Joukkueet() {
  const [teams, setTeams] = useState([]);

  // Fetch teams from the server (you can implement this part)
  useEffect(() => {
    axios.get('http://localhost:3001/api/joukkueet')
      .then((response) => {
        setTeams(response.data);
      })
      .catch((error) => {
        console.error('Error fetching teams:', error);
      });
  }, []);

  return (
    <div>
      <h1>Joukkueet App</h1>
      <Joukkueet teams={teams} /> {/* Pass the teams data to the Joukkueet component */}
    </div>
  );
}

export default Joukkueet;
